import "./App.css";
import "./bootstrap.css";
import "./style.css";
import React, { Component } from "react";
import { BrowserRouter, Route, Link, Routes } from "react-router-dom";
import axios from "axios";

function LoginPage({ doLogin }) {
  const handleSubmit = (e) => {
    e.preventDefault();
    const username = e.target.elements.username.value;
    const password = e.target.elements.password.value;
    doLogin(username, password);
  };

  return (
    <React.Fragment>
    <nav className="navbar navbar-expand-lg bg-body-tertiary fixed-top">
    <div className="container">
      <Link to={"/"} className="navbar-brand m-auto">
        Facegram
      </Link>
    </div>
  </nav>
    <main className="mt-5">
      <div className="container py-5">
        <div className="row justify-content-center">
          <div className="col-md-5">
            <div className="card">
              <div className="card-header d-flex align-items-center justify-content-between bg-transparent py-3">
                <h5 className="mb-0">Login</h5>
              </div>
              <div className="card-body">
              <div className="alert alert-danger text-center d-none" id="alert"></div>
                <form onSubmit={handleSubmit}>
                  <div className="mb-2">
                    <label htmlFor="username">Username</label>
                    <p className="text-danger small d-none" id="userAlert"></p>
                    <input
                      type="text"
                      className="form-control"
                      id="username"
                      name="username"
                    />
                  </div>

                  <div className="mb-3">
                    <label htmlFor="password">Password</label>
                    <p className="text-danger small d-none" id="passAlert"></p>
                    <input
                      type="password"
                      className="form-control"
                      id="password"
                      name="password"
                    />
                  </div>

                  <button type="submit" className="btn btn-primary w-100">
                    Login
                  </button>
                </form>
              </div>
            </div>

            <div className="text-center mt-4">
              Don't have account? <Link to="/register">Register</Link>
            </div>
          </div>
        </div>
      </div>
    </main>
    </React.Fragment>
  );
}

class App extends Component {
  doLogin = (username, password) => {
    const apiUrl = "http://localhost:8000/api/v1/auth/login";

    const alertDiv = document.getElementById('alert');
    axios
      .post(apiUrl, { username, password })
      .then((response) => {
        console.log(response.data.message);
      })
      .catch((error) => {
        if(error.response.status == 401){
          alertDiv.classList.remove('d-none')
          alertDiv.innerHTML = error.response.data.message
        }else{
          if(error.response.data.errors.username){
            document.getElementById('userAlert').classList.remove('d-none')
            document.getElementById('userAlert').innerHTML = error.response.data.errors.username[0]
          }else{
            document.getElementById('userAlert').classList.add('d-none')
          }
          if(error.response.data.errors.password){
             document.getElementById('passAlert').classList.remove('d-none')
             document.getElementById('passAlert').innerHTML = error.response.data.errors.password[0]
            }else{
             document.getElementById('passAlert').classList.add('d-none')
           }
        }
      });
  };

  render() {
    return (
      <BrowserRouter>
        <div>
          <Routes>
            <Route
              path="/login"
              element={<LoginPage doLogin={this.doLogin} />}
            />
            {/* Add other routes as needed */}
          </Routes>
        </div>
      </BrowserRouter>
    );
  }
}

export default App;
